import React, { Component } from 'react';
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom';
import {Route} from 'react-router';

class App extends Component {
  render() {
    return (
     <Router>
       <switch>
            <Route to="/admin/login" component={Admin_Login}/>

       </switch>
     </Router>
    );
  }
}

export default App;
